@Regrann from @zionlion_7 -  Someone asked me to demonstrate how observance of #Torah is greater than sacrifice, so I said ok, let's look at the language:

The word for #commandments in Hebrew is Mitzvot מצות, which comes from the root Tzevah צוה which literally means to #bind or #attach. 
The word for offerings in Hebrew is #Qorban קרבן which comes from the word #Qarev קרב and it literally means to "#draw #near". Each #commandment literally binds or attaches us to #TheAlmighty while an #offering draws us nearer to Him. While drawing near to God is Great, it will #NEVER #EVER trump binding or attaching yourself to Him (613 Torah)! - #regrann
